import React, { useEffect } from 'react';
import AOS from 'aos';
import 'aos/dist/aos.css';
import './home.css'; // Import your CSS file for additional styling

const HomePage = () => {
    useEffect(() => {
        AOS.init({
            duration: 1000,
            once: true
        });
    }, []);

    return (
        <div className="container-fluid">
            {/* HRM VISAS content */}
            <div className="row">
                <div className="col-md-5 section1" data-aos="fade-up" data-aos-delay="200"> {/* Apply fade-up animation */}
                    <div className="content">
                        <h1>Welcome to HRM VISAS</h1>
                        <p>We have been in this specific field of Visa Services since 2008. We have gained experience by processing Thousands of Visa applications. We do Visas, Travel, Flight, Hotel, Insurance, Documentation make easy!.</p>
                    </div>
                </div>

                {/* Image */}
                <div className="col-md-6 image1 pop-up image-container" data-aos="fade-up" data-aos-delay="400"> {/* Apply fade-up animation */}
                    <img src="https://m.economictimes.com/thumb/msid-90650290,width-1200,height-900,resizemode-4,imgsize-65242/1.jpg" alt="Image 1" className="img-fluid" style={{ marginBottom: '20px' }} /> {/* Add margin-bottom */}
                </div>
            </div>

            {/* Add space between image and "About Us" section */}
            <div className="row" style={{ marginBottom: '50px' }}></div>

            {/* Other sections with Bootstrap classes */}
            <div className="row">
                <div className="col-md-12 section2" data-aos="fade-up" data-aos-delay="600"> {/* Apply fade-up animation */}
                    <div className="content">
                        <h2>About Us</h2>
                        <p>We are a company that specializes in...</p>
                    </div>
                </div>
            </div>

            <div className="row">
                <div className="col-md-12 section3" data-aos="fade-up" data-aos-delay="800"> {/* Apply fade-up animation */}
                    <div className="content">
                        <h2>Our Services</h2>
                        <p>We offer a variety of services including...</p>
                    </div>
                </div>
            </div>

            <div className="row">
                <div className="col-md-12 section4" data-aos="fade-up" data-aos-delay="1000"> {/* Apply fade-up animation */}
                    <div className="content">
                        <h2>Contact Us</h2>
                        <p>Get in touch with us at...</p>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default HomePage;
